/*
composant affichant la liste du personnel actif ainsi que les inactifs
 */
import React from 'react';
import ActiveHumans from './activeHumans';
import InactiveHumans from './InactiveHumans';

function App() {
    return (
        <div>
            <ActiveHumans />
            <InactiveHumans />
        </div>
    );
}

export default App;
